import React from 'react'
import RegisterForm from '../components/users/RegisterForm';
import styled from 'styled-components';

const Register = () => {
    return (
        <RegisterContainer>
            <div className="left">
                <section>
                    <h1>PLACEHOLDER TITLE</h1>
                    <p>I AM THE DESCRIPTION OF THE WEBSITE. CHANGE ME!</p>
                </section>
            </div>
            <div className="right">
                <RegisterForm />

            </div>
        </RegisterContainer>
    )
}

export default Register

const RegisterContainer = styled.div`
    text-align: left;
    padding: 0;
`
